import { Injectable } from "@angular/core";
import { AppService } from "../app.service";
import { Actions, createEffect, ofType } from "@ngrx/effects";
import { categoriesObtained, InitApp, SecondaryToolbarActions } from './app.actions';
import { filter, map, switchMap } from "rxjs";
import { Button } from "@root/components/models";
import { RegisterToolbar } from "@root/components/toolbar/state/toolbar.actions";
import { SECONDARY_TOOLBAR_ID } from "../app-constants";

@Injectable()
export class AppEffects {
    public initCategorias$ = createEffect(() =>
        this.actions.pipe(
            ofType(InitApp),
            switchMap(() => this.service.ObtenerCategorias()),
            filter(categorias => !!categorias),
            map(categorias => categoriesObtained({categorias}))
            ));

    public registerSecondaryToolbar$ = createEffect(() =>
        this.actions.pipe(
            ofType(categoriesObtained),
            filter(({categorias}) => !!categorias),
            map(({categorias}) => {
                let secondaryButtons: Button[] = [];
                categorias.forEach(cat => {
                    let button : Button = {
                        type: 'fab',
                        label: cat.nombre,
                        icon: '',
                        action: SecondaryToolbarActions.buttonClicked({categoriaId: cat.id})
                      };
                      secondaryButtons.push(button);
                });
                return RegisterToolbar({
                    toolbar: {
                        id: SECONDARY_TOOLBAR_ID,
                        secondaryButton: secondaryButtons,
                        toolbarConfig:{
                          isSecondaryToolbar:true,
                          isTitleSeparete: false
                        }
                      }
                })
            })
        ));

    public setFirstCategoryAsCurrent$ = createEffect(() =>
        this.actions.pipe(
            ofType(categoriesObtained),
            filter(({categorias}) => !!categorias),
            map(({categorias}) => SecondaryToolbarActions.buttonClicked({
                categoriaId: categorias[0].id
            }))
        ));

    public secondaryButtonClicked$ = createEffect(() =>
        this.actions.pipe(
            ofType(SecondaryToolbarActions.buttonClicked),
            switchMap(action => this.service.ObtenerCategoriaPorId(action.categoriaId)),
            filter(categoria => !!categoria),
            map((categoria) => SecondaryToolbarActions.categoriaCargada({categoria})),
        ));

    constructor(
        private actions: Actions,
        private readonly service: AppService){}
}

import { Injectable } from "@angular/core";
import { Action, Store } from "@ngrx/store";
import { selectAllToolbars } from "@root/components/toolbar/state/toolbar.selectors";
import { filter, map, Observable } from "rxjs";
import { getCurrentCategory, getCurrentCategoryItems, getCurrentCategoryName, getCurrentUserProfile, getMenuOpened, getShoppingCartCount, getShoppingCartOpened } from "./state/app.selectors";
import { WebApiService } from "./web-api.service";
import { UserProfile } from "./identity/models";
import { Categoria, Item } from "@root/components/models";

@Injectable({
    providedIn: 'root'
})
export class AppService {
    public isMenuOpened$: Observable<boolean>;
    public isShoppingCartOpened$: Observable<boolean>
    public currentUserProfile$: Observable<UserProfile | undefined>;
    public currentCategory$: Observable<Categoria | undefined>;
    public currentCategoryName$: Observable<string>;
    public currentCategoryItems$: Observable<Item[]>;
    public shoppingCartCount$: Observable<number>;

    constructor(
        private store: Store,
        private webApi: WebApiService){
        this.isMenuOpened$ = this.store.select(getMenuOpened);
        this.isShoppingCartOpened$ = this.store.select(getShoppingCartOpened);
        this.currentUserProfile$ = this.store.select(getCurrentUserProfile);
        this.currentCategory$ = this.store.select(getCurrentCategory);
        this.currentCategoryName$ = this.store.select(getCurrentCategoryName);
        this.currentCategoryItems$ = this.store.select(getCurrentCategoryItems);
        this.shoppingCartCount$ = this.store.select(getShoppingCartCount);
    }

    public dispatch(action: Action){
        this.store.dispatch(action);
    }

    public getToolbarById(id: string) {
        return this.store.select(selectAllToolbars).pipe(
            map(toolbars => toolbars.find(t => t.id == id))
        )
    }

    public crearCategoria(nombre: string){
        this.webApi
            .crearCategoria({nombre: nombre})
            .pipe(filter(x => !!x))
            .subscribe(categoria => console.log(categoria));
    }
    public ObtenerCategorias() {
        return this.webApi
            .obtenerCategorias()
            .pipe(filter(x => !!x));
    }
    public ObtenerCategoriaPorId(categoriaId: string) {
        return this.webApi
            .obtenerCategoriaById(categoriaId)
            .pipe(filter(x => !!x));
    }
}

